import Link from 'next/link';
import Head from 'next/head';

const Navbar = (props) => {
    return(
        <div>
            <Head>
                <script src="/public/assets/js/script.js"></script>
            </Head>
            <ul>
                <li>
                <Link href={{ pathname: '/dashboard/55', }}><a>Dashboard</a></Link>
                </li>
            </ul>
            {props.children}
        </div>
    )
}

export default Navbar;
